import React, { useState } from "react";
import "./ExpenseForm.css";

const ExpenseForm = (props) => {
  // Using three states
  const [title, setTitle] = useState("");
  const [amount, setAmount] = useState("");
  const [date, setDate] = useState("");

  const titleChangeHandler = (e) => {
    setTitle(e.target.value);
  };

  const amountChangeHandler = (e) => {
    setAmount(e.target.value);
  };

  const dateChangeHandler = (e) => {
    setDate(e.target.value);
  };

  /*
  //   Using one state instead of three states
  const [userInput, setUserInput] = useState({
    title: "",
    amount: "",
    date: "",
  });
  */

  /*
  const titleChangeHandler = (e) => {
    // Form of updating state when the new state depends on the previous state
    setUserInput({
      ...userInput,
      title: e.target.value,
    });

    setUserInput(() => {
      return { title: e.target.value, ...userInput };
    });
  };
  */

  /*
  const amountChangeHandler = (e) => {
    // Form of updating state when the new state depends on the previous state
    /*
    setUserInput({
      ...userInput,
      date: e.target.value,
    });


    setUserInput(() => {
      return { amount: e.target.value, ...userInput };
    });
  };

  const dateChangeHandler = (e) => {
    // Form of updating state when the new state depends on the previous state
    /*
    setUserInput({
      ...userInput,
      amount: e.target.value,
    });


    setUserInput(() => {
      return { date: e.target.value, ...userInput };
    });
  };
  */

  // Using one state instead of three states
  /*
  const inputChangeHandler = (identifier, value) => {
    if (identifier === "title") {
      setTitle(value);
    } else if (identifier === "amount") {
      setAmount(value);
    } else {
      setDate(value);
    }
  };

  */

  const submitHandler = (e) => {
    e.preventDefault();

    const expenseData = {
      title: title,
      amount: amount,
      date: new Date(date),
    };
    props.onSaveExpenseData(expenseData);
    setTitle("");
    setAmount("");
    setDate("");
  };

  return (
    <>
      <form onSubmit={submitHandler}>
        <div className="new-expense__controls">
          <div className="new-expense__control">
            <label htmlFor="">Title</label>
            <input type="text" value={title} onChange={titleChangeHandler} />
          </div>
          <div className="new-expense__control">
            <label htmlFor="">Amount</label>
            <input
              type="number"
              min="0.01"
              step="0.01"
              value={amount}
              onChange={amountChangeHandler}
            />
          </div>
          <div className="new-expense__control">
            <label htmlFor="">Date</label>
            <input
              type="date"
              min="2019-01-01"
              max="2024-12-31"
              value={date}
              onChange={dateChangeHandler}
            />
          </div>
        </div>
        <div className="new-expense__actions">
          <button type="submit">Add Expense</button>
        </div>
      </form>

      {/* Other form - Ellegant */}
      {/*       
      <form>
        <div className="new-expense__controls">
          <div className="new-expense__control">
            <label htmlFor="">Title</label>
            <input
              type="text"
              onChange={(e) => inputChangeHandler("title", e.target.value)}
            />
          </div>
          <div className="new-expense__control">
            <label htmlFor="">Amount</label>
            <input
              type="number"
              min="0.01"
              step="0.01"
              onChange={(e) => inputChangeHandler("amount", e.target.value)}
            />
          </div>
          <div className="new-expense__control">
            <label htmlFor="">Date</label>
            <input
              type="date"
              min="2019-01-01"
              max="2024-12-31"
              onChange={(e) => inputChangeHandler("date", e.target.value)}
            />
          </div>
        </div>
        <div className="new-expense__actions">
          <button type="submit">Add Expense</button>
        </div>
      </form>
       */}
    </>
  );
};

export default ExpenseForm;

