sourcesContent:
import React, { useEffect, useState } from "react";
import "./ApiTeste.css";

const API_URL = "http://192.168.68.113:36147/queue";

const ApiTeste = () => {
  const [date, setDate] = useState([]);
  useEffect(() => {
    getQueue();
  }, []);
  const getQueue = async () => {
    try {
      const res = await fetch(API_URL);
      const data = await res.json();
      setDate(data.items);
      return data.items;
    } catch (error) {
      throw new Error("Error: ", error);
    }
  };
  console.clear();
  console.log("Date", date);
  //   console.log("Date", date[0].createdAt);

  return (
    <div>
      <h2>JSON Data Table</h2>
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Group</th>
            <th>Start Time</th>
            <th>Player</th>
            <th>Match</th>
            <th>Sport</th>
            <th>Channel</th>
            <th>Target</th>
            <th>Origin</th>
            <th>Type</th>
            <th>Bet ID</th>
            <th>Processed</th>
            <th>Failure Count</th>
            <th>User ID</th>
            <th>Created At</th>
            <th>Updated At</th>
            <th>__v</th>
            <th>Block Until</th>
          </tr>
        </thead>
        <tbody>
          {date.map((item, index) => (
            <tr key={item._id}>
              <td>{index + 1}</td>
              <td>{item.data.group}</td>
              <td>{item.data.startAt}</td>
              <td>{item.data.player}</td>
              <td>{item.data.match}</td>
              <td>{item.data.sport}</td>
              <td>{item.data.channel}</td>
              <td>{item.data.target}</td>
              <td>{item.data.origin}</td>
              <td>{item.data.type}</td>
              <td>{item.data.betId}</td>
              <td>{String(item.processed)}</td>
              <td>{item.failureCount}</td>
              <td>{item.userId}</td>
              <td>{item.createdAt}</td>
              <td>{item.updatedAt}</td>
              <td>{item.__v}</td>
              <td>{item.blockUntil}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ApiTeste;
